            even_sum += a[i]
        else:
            odd_sum += a[i]

    # if odd_sum is odd, the answer is the sum of odd numbers
    if odd_sum % k!= 0:
        return str(odd_sum)
    # otherwise, the answer is the sum of even numbers
    else:
        return str(even_sum)

