class Trie:
    def __init__(self):
        self.children = {}
        self.is_word = False

    def add(self, word):
        self.is_word = True
        if not self.children:
            self.children = {}
        for i in range(len(word)):
            self.children[word[i]] = Trie()

    def search(self, word):
        if not word:
            return self.is_word
        if not self.children:
            return False
        for i in self.children.keys():
            if word[0] == i:
                return self.search(word[1:])
        return False

    def __contains__(self, word):
        if not word:
            return self.is_word
        if not self.children:
            return False
        for i in self.children.keys():
            if word[0] == i:
                return self.search(word[1:])
        return False


