    def numberOfSelfloops(self, n: int, edges: List[List[int]]) -> int:
        visited = [False] * n
        num_self_loops = 0
        for edge in edges:
            if visited[edge[0]] is False:
                num_self_loops += 1
                visited[edge[0]] = True
            if visited[edge[1]] is False:
                num_self_loops += 1
                visited[edge[1]] = True
        return num_self_loops

